import React, { useState } from 'react';
import { getData, updateData } from '../services/api';

const EditPage = () => {
  const [data, setData] = useState(getData());

  const handleUpdate = (id, newData) => {
    const updatedData = updateData(id, newData);
    setData(updatedData);
  };

  return (
    <div>
      <h1>Edit Data</h1>
      <ul>
        {data.map((item, index) => (
          <li key={index}>
            {item.name} <button onClick={() => handleUpdate(index, { name: 'Updated' })}>Edit</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EditPage;
